#1)Stationary
def check_for_Stationary(data,test:str='ADCF'):
  #since both the functions will also return a dataframe for analysis later on
  if test == 'ADCF':
    AugmentedDickeyFullerTest(data)
  else:
    return rollingStatics(data)

#this is designed for a dataset with only two features
def AugmentedDickeyFullerTest(data):
  from statsmodels.tsa.stattools import adfuller
  print("Observations of Dickey-fuller test")
  dftest = adfuller(data[data.columns[1]],autolag='AIC') #Can BIC be also used?
  dfoutput=pd.Series(dftest[0:4],index=['Test Statistic','p-value','#lags used','number of observations used'])
  for key,value in dftest[4].items():
    dfoutput['critical value (%s)'%key]= value
  print(dfoutput)

#This is how we determine whether the null hypothesis is valid or not
'''
p-value > 0.05: Fail to reject the null hypothesis (H0), the data has a unit root and is non-stationary.

p-value <= 0.05: Reject the null hypothesis (H0), the data does not have a unit root and is stationary.
'''

#One has to determine the critical value though
'''
Deducing the hypothesis:
In this method, we take a null hypothesis that the data is non-stationary.
After executing this test, it will give some results comprised of test
statistics and some other critical values that help to define the
stationarity. If the test statistic is less than the critical 
value then we can reject the null hypothesis and say 
that the series is stationary.
'''

def rollingStatics(data,window:int=12):
  rmean=data.rolling(window=window).mean()
  rstd=data.rolling(window=window).std() 
  #handling the nan values
  #since it is obvious for the starting n-1 windows for a window of of size n mean and std will be zero 
  rmean=rmean.fillna(0)
  rstd=rstd.fillna(0)
  Mean = rmean[rmean.columns[0]]
  STD = rstd[rstd.columns[0]]
  #creating a new dataframe that will be returned
  index=[]
  for i in range(0,len(Mean)):
    index.append(i)
  columns=['Rolling Mean','Rolling Standard Deviation']
  dataValues=[]
  for val1,val2 in zip(Mean,STD):
    dataValues.append([val1,val2])
  
  Record=pd.DataFrame(data=dataValues,index=index,columns=columns)
  plotRollingStatics(Record,data)
  return Record
  

#this function will visualize the data from the rolling statistics function
def plotRollingStatics(Stats,data):#first is the stats data and second is the original data
  rmean=Stats[Stats.columns[0]]
  rstd=Stats[Stats.columns[1]]
  orig=plt.plot(data[data.columns[1]] , color='black',label='Original')
  mean= plt.plot(rmean , color='red',label='Rolling Mean')
  std=plt.plot(rstd,color='blue',label = 'Rolling Standard Deviation')
  plt.legend(loc='best')
  plt.title("Rolling mean and standard deviation")
  plt.show(block=False)

