#cumulative moving average
def cumulativeMovingAverage(data):
  data['CMA'] = data[data.columns[1]].expanding().mean()#this will give the cummulative frequency
  colors = ['green', 'orange']
  # line plot - the yearly average air temperature in Barcelona
  data[[data.columns[1], 'CMA']].plot(color=colors, linewidth=3, figsize=(12,6))
  # modify ticks size
  plt.xticks(fontsize=14)
  plt.yticks(fontsize=14)
  plt.legend(labels =[f'Cummulative Average {data.columns[1]}', 'CMA'], fontsize=14)
  # title and labels
  plt.title(f'Cum_avg_{data.columns[1]}', fontsize=20)
  plt.xlabel(f'{data.columns[0]}', fontsize=16)
  plt.ylabel(f'{data.columns[1]}', fontsize=16)

#this will model the dataset based on weighted smoothing
def weightedMovingAverage(data,weights:list=[1.0,0.9,0.8,0.7,0.6,0.5,0.4,0.3,0.2,0.1],window:int=10):
  sum_weights = np.sum(weights)
  data['weighted_ma'] = (data[data.columns[1]].rolling(window=window, center=True)
  .apply(lambda x: np.sum(weights*x) / sum_weights, raw=False))
  colors = ['magenta', 'orange']
  # line plot - the yearly average air temperature in Barcelona
  data[[f'{data.columns[1]}', f'{data.columns[2]}']].plot(color=colors, linewidth=3, figsize=(12,6), alpha=0.8)
  # modify ticks size
  plt.xticks(fontsize=14)
  plt.yticks(fontsize=14)   
  plt.legend(labels=[f'Weighted Average {data.columns[1]}', f'{data.columns[2]}'], fontsize=14)
  # title and labels
  plt.title(f'Weighted avearage of {data.columns[1]}', fontsize=20)
  plt.xlabel(f'{data.columns[0]}', fontsize=16)
  plt.ylabel(f'Wt_avg{data.columns[1]}', fontsize=16)
  

